import axios from 'axios'

export default async function queryBackEnd(query, type, playerNames) {
    if (type === 'team') {
        const result = await updatePlayerNames(query)
        return result
    }
    return getPlayer(query, playerNames)
}

const updatePlayerNames = async (Id) => {
    try {
      const { data: playerNames } = await axios.get(`http://localhost:5000/teams/${Id}`)
      return playerNames
    } catch (e) {
      console.log(e)
    }
}

const getPlayer = async (playerId, playerNames) => {
    try {
        console.log(`http://localhost:5000/players/${playerNames[playerId - 1]}`)
        const { data } = await axios.get(`http://localhost:5000/players/${playerNames[playerId - 1]}`)
        console.log(`http://localhost:5000/players/${playerNames[playerId - 1]}`)
        console.log(data)
        return data[0]
    } catch (e) {
        console.log(e)
    }
}
